    public int getCountByKeywords(String str, String s) {
        int length=str.length();
        int count = 0;
        int k = 0;
        for(int i= 0; i<=length; i++){
            if(str.indexOf(s) == (i-k)){
                str = str.substring(i-k+1,str.length());
                count++;
                k = i+1;
            }
        }
        System.out.println(s+""+count+"");
        return count;
    }
